title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o5321.m21 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31
  o5321.m2 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31
  o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31 -> o5321.m6
  o5321.m33 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33
  o5287.m32 -> o5287.m23 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31
  o5321.m5 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31
  o5287.m23 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31
  o5321.m3 -> o5287.m34 -> o5321.m33 -> o5287.m31 -> o5321.m6 -> o5287.m34
  o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31
  o5321.m7 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31
  o5287.m34 -> o5321.m33 -> o5287.m31 -> o5321.m6 -> o5287.m34
  o5287.m20 -> o5321.m33 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33
  o5321.m30 -> o5287.m31 -> o5321.m6 -> o5287.m34 -> o5321.m33 -> o5287.m31

features:
  - inheritance
  - overriding
  - method
  - polymorphism

